docs/COMPONENTS.html.body:
Components
Next we will start writing out our components. This will serve as a good introduction to React.
Initialize

First we will add the needed dependencies for developing a React application:yarn add react

And the needed developer dependencies for React development (with TypeScript):yarn add -D @types/react tslint-react
The package @types/react gives us type definitions for React and tslint-react allows us to use TSLint to lint our React components.

Configuring for React
First we will configure TypeScript to work with JSX by adding the following line to our tsconfig.json:
{
    "compilerOptions": {
        "jsx": "react",
        // Rest of the compiler options
    }
    // Rest of the config file
}

As we are not using another transformation step setting jsx to the value of react will emit the actual JavaScript after compilation.

To use tslint-react we add the following lines to the file tslint.json:
{
    "extends": ["tslint-react"], // This will allow us to use tslint-react-specific rules
    "rules": {
        "jsx-no-lambda": false, // This disallows the definition of functions inside a React Component's render-function
        // The rest of the rules
        "quotemark": [true, "single", "jsx-double"] // We added "jsx-double" here to denote that in JSX one should use double quotation marks.
    }
}

Button
We will start with the simplest component that utilizes all the tools we need for most components, a Button, so go ahead and create a file Button.tsx (the extension defines the file as a TypeScript-file that has JSX in it) in the folder components:
import * as React from 'react';

interface IButtonProps {
    click(): void;
    readonly text: string;
}

const Button: React.StatelessComponent = ({ click, text }) => (
     click()} value={text} />
);

export default Button;

In the first row
import * as React from 'react';

we import all the functionalities provided by React under the name React (* as React), including the ability to write JSX (those things that look like HTML).

On the third to sixth rows
interface IButtonProps {
    click(): void;
    readonly text: string;
}

we define an interface to denote the properties (or props for short) our component accepts (and in this case needs). click() defines a function, which will be known as click inside our Button and as we have only defined that it takes no arguments, we also tell the compiler that we don't care if it returns anything, just that it can be called, using the return type of void. readonly text: string on the other hand defines a readonly (an immutable property) called text inside our Button, that is of the type string.

Interfaces are shapes we define, meaning that we do not care what the actual implementation is, just that it has those types of values with those names. They cannot be instantiated as such and thus cannot contain default values like classes.


On the eighth to tenth rows
const Button: React.StatelessComponent = ({ click, text }) => (
     click()} value={text} />
);

we define a constant (an immutable variable) called Button which is of the type React.StatelessComponent, meaning it is a React component, which does not have an internal state, but only props of type IButtonProps. Stateless components in React only need to define their render-method and using an ES6 arrow function and a destructuring assignment we can return JSX with our props already defined as simple variables (in this case "click" and "text"). The actual return here is a simple HTML input element with a class of btn (in React you define classes with the property "className"), a type of submit, an onClick-handler that will simply call the click-property and a value of text (in submit buttons the value is the text in the button).

You need to surround JSX with normal braces.


And finally on the twelfth row
export default Button;

we export our Button as the default export of the module.
TodoComponent
Next we will define a component to visualize our Todo-class from the previous section, creating a file called TodoComponent.tsx in the components-folder:
import * as React from 'react';
import Todo from '../common/Todo';

export interface ITodoComponent {
    readonly todo: Todo;
    setDone(i: number): void;
}

const TodoComponent: React.StatelessComponent = ({ todo, setDone }) => (

         !todo.done && setDone(todo.id)}
        />
        {todo.id}:
        {todo.title}

);

export default TodoComponent;

which is mostly very similar to our Button. The biggest differences here are the second import
import Todo from '../common/Todo';

which imports our Todo-class using a relative path (the compiler will look for the file relative to the current file) and the second property in our interface
    setDone(i: number): void;

which defines a function called setDone that takes one argument, which is a number.
Loader
Lastly we implement our third and simplest component, called a Loader, in a file called Loader.tsx in the components-directory
import * as React from 'react';

const Loader: React.StatelessComponent = () => (



);

export default Loader;

which uses all previously introduced tools, except this time we have defined the props it receives as undefined, meaning that it does not take any props at all.
Alternatives
Below you can find alternatives to React, although I would suggest React unless you have specific needs, which other frameworks solve better, as it also allows for mobile development with React Native.

AngularJS, possibly the most popular framework after React
elm, a functional alternative
Cycle.js, a functional reactive alternative

docs/REDUX.html.body:
Redux
Next we will setup redux to handle the state for our application (redux allows us to keep our components pure, helping testing and predictability).

You can think of redux as an implementation of the Flux pattern.

Initialize

This time we will only need to add the necessary dependencies to allow development with redux:yarn add redux redux-observable rxjs
This time we don't need to add type-packages, as all of the added dependencies are either built with TypeScript or contain type definitions for it.
Redux-observable is our choice for allowing side effects, such as AJAX-calls in redux. RxJS is a peer dependency for redux-observable. If you want something else you can check the alternatives.



Creating utilities
We will begin by creating a file called utils.js inside the folder redux in src. This file will contain helpers for our redux functionalities and will serve as good introduction into one of its most basic building blocks. The file will initially look like this:
export type DefaultAction = { type: '' };
export const DefaultAction: DefaultAction = { type: '' };

Actions are the only way to send new content to the redux-state, and are usually in the form of an object with the properties type (a unique string) and an optional payload (something to pass to the state). Here we have defined a DefaultAction which will allow our reducers to pass unnecessary actions forward without losing type-safety. The empty string as a type ensures that it doesn't intersect with any of our own actions.
Reducer
Now we will define our root-reducer in a file called reducer.ts inside the folder redux:
import { combineReducers } from 'redux';
import { combineEpics } from 'redux-observable';
import { DefaultAction } from './utils';

const reducer = combineReducers({
});

export class State {
}

export const epics = combineEpics(
);

export type Actions = DefaultAction;

export default reducer;

This file will allow us to export all of the following:

Our root reducer (all specific reducers will be combined into this done, as according to redux documentation, allowing our reducers to only handle a slice of the entire state) made with combineReducers
The class of our entire state (defined as a class to allow initialization in for example tests)
Our combined epics (more about epics later) made with combineEpics
The type of all of our actions

Store
Now we will define our store creator (having it as a separate function helps us in doing server-side rendering, but if you don't want to do it you can define this function later) in a file called store.ts inside the redux-folder:
import { createStore, applyMiddleware } from 'redux';
import { createEpicMiddleware } from 'redux-observable';
import reducer, { epics, State } from './reducer';

const epicMiddleware = createEpicMiddleware(epics);

const configureStore = (): Store => createStore(
    reducer,
    applyMiddleware(epicMiddleware),
);

export default configureStore;


On the fifth line we create a middleware for our store to handle our epics, using createEpicMiddleware (and here you see why we combined all our epics into one):
import { createEpicMiddleware } from 'redux-observable';
import { epics } from './reducer';
const epicMiddleware = createEpicMiddleware(epics);


And then on the seventh line we define our store creator method (which is exported on the 14th line):
import { createStore, applyMiddleware, Store } from 'redux';
import reducer, { State } from './reducer';
const configureStore = (): Store => createStore(
    reducer,
    applyMiddleware(epicMiddleware),
);
export default configureStore;

createStore is the function that creates a Store for redux and as it's first argument it takes the root-reducer and as the second one all the applicable middleware (combined with applyMiddleware), in this case our epicMiddleware.

Now we have everything set up to start doing the beef of the application, a.k.a. the views!
Alternatives
If redux doesn't float your boat, you can always try MobX, but redux is maybe the more used one at this point.
For redux-observable you have multiple alternatives, namely:

redux-loop, which is inspired by elm's effect system
redux-thunk
redux-saga

docs/VIEWS.html.body:
Views
Now we are ready to start working towards the beef of the application: different pages (or views).
IndexView
We will begin by creating a file called IndexView.tsx (remember that 'x' in the end of the file type means that it contains jsx) inside a folder called index inside the components-folder:

All of our pages will be inside folders named after the page, in this case Index and the view will be named [Pagename]View.tsx

import * as React from 'react';
import Todo from '../../common/Todo';
import TodoComponent from '../../components/TodoComponent';
import Button from '../../components/Button';
import Loader from '../../components/Loader';

interface IIndexState {
    title: string;
    todos: Todo[];
    loading: boolean;
}

interface IIndexDispatch {
    setTitle(n: string): void;
    saveTodo(): void;
    setDone(i: number): void;
}

type IIndexProps = IIndexState & IIndexDispatch;

const IndexView: React.StatelessComponent = ({ title, todos, loading, setTitle, saveTodo, setDone }) => (

        {loading && }
        Todo app
         e.preventDefault()}>
            Add a new todo:
             setTitle(e.target.value)}
            />




            {todos.map(t => )}


);

export default IndexView;


The first interface we declare, called IIndexState
import Todo from '../../common/Todo';
interface IIndexState {
    title: string;
    todos: Todo[];
    loading: boolean;
}

is an interface that holds the "state"-values for our View, e.g. the stuff that defines what is shown to the user, in this case a title (the title of the current Todo being created), a list of Todos (the current Todos) and a boolean that indicates whether or not some kind of AJAX-call is currently running.

The second interface we declare, called IIndexDispatch
interface IIndexDispatch {
    setTitle(n: string): void;
    saveTodo(): void;
    setDone(i: number): void;
}

is an interface that holds all the "dispatch"-functions for our View, e.g. all the functionality that our users can trigger, in this case a function (setTitle(n: string)) to change the current title (that takes a string as an argument), a function (saveTodo()) to save the new Todo and a function (setDone(i: number)) to set an existing Todo as done (that takes the number of the Todo as argument).

Having void as a return type allows us to not care about the return type (which we don't need here) without having an implicit any


Together IIndexState and IIndexDispatch form the type IIndexProps
type IIndexProps = IIndexState & IIndexDispatch;

which is the definition of all the props our IndexView will need to function.

The IIndexState & IIndexDispatch part defines that the type called IIndexProps is an intersection of those two interfaces, meaning that to fulfill the type, the object needs to have all values present in both of the aforementioned interfaces.


And now we get to the beef of it all, starting with declaring the actual IndexView
import * as React from 'react';
const IndexView: React.StatelessComponent = ({ title, todos, loading, setTitle, saveTodo, setDone }) => (
);

in which we declare a constant called IndexView which is of the type React.StatelessComponent. React.StatelessComponent is a type of React Component that does not have an internal state, only props and can be declared as a function that returns jsx, where the type of props received is put inside the angle brackets (where T is now).

These kinds of declarations are called type arguments or generics, which allow you to define a function without knowing beforehand what the type of the argument or return value is.

After declaring the const we define IndexView to be a function, that fulfills the render function, i.e. takes in an object containing the declared properties (using object destructuring so we don't have to write something.title, instead of title) and returns jsx encapsulated in the brackets.

For the actual content inside the brackets you can think of it as "HTML on steroids", beginning, as is semantically correct with a main tag



which will hold all the content of our IndexView (and here we begin the introduction of BEM-naming).

Next is our first tag that is different with different props
import Loader from '../../components/Loader';
// ...

        {loading && }


which means, that depending if the prop loading is true (using logical operator-shorthand that returns the right hand-side if the both sides evaluate as true), we want to render the Loader-component we defined earlier in the Components section.

Next up we define the title and a form to add a new Todo

    // ...

        Todo app
         e.preventDefault()}>
            Add a new todo:
             setTitle(e.target.value)}
            />




where we first define the title (in this case a static string Todo app). Next we define a form to create new Todos which introduces us to a lot of nice features of React, but first we do a little "hack" as we want to enable the user to press the enter-key when submitting a new Todo but we don't want to send the form to a new page, we set the value of onSubmit (the handler for a form's submit method in React) as e => e.preventDefault() where e is the event received and it's function .preventDefault() will (as its name implies) prevent the default functionality (in this case send the form data to the current url, causing a reload).
Next we define a label for the input-field utilizing React's htmlFor-value which is an alias for the for-attribute. Then we define the actual input-field for inputting a Todo, which is a simple text input, but we also make it autofocus (if you open the page, you can start typing into it directly) and make it a controlled component, meaning that whenever the value of title changes, the input will also update. We also add the onChange-listener to actually set the new title the user has typed in. Finally we create a simple Button (we defined earlier in components) to submit the form.

Finally we want to of course show all the Todos created

        // ...

            {todos.map(t => )}



where we first encapsulate it into a semantic tag called section. Then we want to create a new TodoComponent (as we defined in components) for every Todo in our current state, which can be achieved by a simple map (I highly recommend getting to know all the major Array-functions). Here you want to also remember to add a property for our TodoComponent it isn't expecting to receive: key which React uses to distinguish between tags in a list (it has to be unique inside the list).
Alternatives

If you want something a bit simpler you can try Vue.js
Or the classic jQuery

docs/REDUCERS.html.body:
Reducers
Now we build our business logic, also known as reducers. Stay calm, this will be a bit more complicated then anything before.
IndexReducer
We begin by creating a file called IndexReducer.ts in the src/modules/index-folder

Our reducers follow the naming pattern of [Foldername]Reducer

import { MiddlewareAPI } from 'redux';
import { Observable } from 'rxjs/observable';
import { ajax } from 'rxjs/observable/dom/ajax';
import 'rxjs/add/operator/delay';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/mapTo';
import { Epic, combineEpics, ActionsObservable } from 'redux-observable';
import { DefaultAction } from '../../redux/utils';
import Todo from '../../common/Todo';

export class IndexState {
    readonly title: string = '';
    readonly todos: Todo[] = [];
    readonly loading: boolean = false;
}

type SET_TITLE = 'boilerplate/Index/SET_TITLE';
const SET_TITLE: SET_TITLE = 'boilerplate/Index/SET_TITLE';
type SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
const SAVE_TODO: SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
type SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
const SAVE_TODO_SUCCESS: SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
type SET_DONE = 'boilerplate/Index/SET_DONE';
const SET_DONE: SET_DONE = 'boilerplate/Index/SET_DONE';
type SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';
const SET_DONE_SUCCESS: SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';

type SetTitleAction = { type: SET_TITLE, payload: string };
export const setTitle = (title: string): SetTitleAction => ({ type: SET_TITLE, payload: title });
type SaveTodoAction = { type: SAVE_TODO };
export const saveTodo = (): SaveTodoAction => ({ type: SAVE_TODO });
type SaveTodoSuccessAction = { type: SAVE_TODO_SUCCESS };
const saveTodoSuccess = (): SaveTodoSuccessAction => ({ type: SAVE_TODO_SUCCESS });
type SetDoneAction = { type: SET_DONE, payload: number };
export const setDone = (i: number) => ({ type: SET_DONE, payload: i });
type SetDoneSuccessAction = { type: SET_DONE_SUCCESS, payload: number };
const setDoneSuccess = (i: number): SetDoneSuccessAction => ({ type: SET_DONE_SUCCESS, payload: i });

export type IndexActions = SetTitleAction | SaveTodoAction | SaveTodoSuccessAction | SetDoneAction | SetDoneSuccessAction | DefaultAction;

const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SAVE_TODO)
        .delay(1000)
        .mapTo(saveTodoSuccess());

const setDoneEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SET_DONE)
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

export const IndexEpics = combineEpics(saveTodoEpic, setDoneEpic);

const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState => {
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }
};

export default IndexReducer;


First we define the state for our IndexReducer

Reducers usually define their own state and we'll show you later how to connect it to the main reducer and state

import Todo from '../../common/Todo';

export class IndexState {
    readonly title: string = '';
    readonly todos: Todo[] = [];
    readonly loading: boolean = false;
}

which is fairly simple. Here we define the IndexState as a class, with the given properties (make sure you add default values for required properties so you can instantiate it!), with the title for the current Todo the user is creating, todos for the list of current Todos and loading to show the user whether the application is performing an async call or not.

Next up we define our action types
type SET_TITLE = 'boilerplate/Index/SET_TITLE';
const SET_TITLE: SET_TITLE = 'boilerplate/Index/SET_TITLE';
type SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
const SAVE_TODO: SAVE_TODO = 'boilerplate/Index/SAVE_TODO';
type SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
const SAVE_TODO_SUCCESS: SAVE_TODO_SUCCESS = 'boilerplate/Index/SAVE_TODO_SUCCESS';
type SET_DONE = 'boilerplate/Index/SET_DONE';
const SET_DONE: SET_DONE = 'boilerplate/Index/SET_DONE';
type SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';
const SET_DONE_SUCCESS: SET_DONE_SUCCESS = 'boilerplate/Index/SET_DONE_SUCCESS';

which redux recommends to be constant strings. The reason we first define a type for the action type is to get TypeScript to do some of the work for us, by ensuring that each instance of the action type has the same value, so for example a constant of SET_TITLE: SET_TITLE = 'notcorrect' would raise a compiler error from TypeScript as it is not equal to boilerplate/Index/SET_TITLE.

Here we follow the redux-ducks naming pattern of the format applicationName/ViewName/ACTION_TYPE


Next we define our action creators which are functions that return an action
type SetTitleAction = { type: SET_TITLE, payload: string };
export const setTitle = (title: string): SetTitleAction => ({ type: SET_TITLE, payload: title });
type SaveTodoAction = { type: SAVE_TODO };
export const saveTodo = (): SaveTodoAction => ({ type: SAVE_TODO });
type SaveTodoSuccessAction = { type: SAVE_TODO_SUCCESS };
const saveTodoSuccess = (): SaveTodoSuccessAction => ({ type: SAVE_TODO_SUCCESS });
type SetDoneAction = { type: SET_DONE, payload: number };
export const setDone = (i: number) => ({ type: SET_DONE, payload: i });
type SetDoneSuccessAction = { type: SET_DONE_SUCCESS, payload: number };
const setDoneSuccess = (i: number): SetDoneSuccessAction => ({ type: SET_DONE_SUCCESS, payload: i });

of a specific type with a specific payload (which is the way to pass new information to the reducer). In this case we also first define the type for each of the possible actions at the same time as the action creator.

After defining our actions and action creators we also create a combined type of all of them
import { DefaultAction } from '../../redux/utils';

export type IndexActions = SetTitleAction | SaveTodoAction | SaveTodoSuccessAction | SetDoneAction | SetDoneSuccessAction | DefaultAction;

to allow us to later define when we want to receive an action for our Index-page and later combine them to create a shared type for all the actions in our application.

Next we define our Epics
import { Observable } from 'rxjs/observable';
import 'rxjs/add/operator/delay';
import 'rxjs/add/operator/map';
import 'rxjs/add/operator/mapTo';
import { Epic, combineEpics, ActionsObservable } from 'redux-observable';

const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SAVE_TODO)
        .delay(1000)
        .mapTo(saveTodoSuccess());

const setDoneEpic: Epic = (action$: ActionsObservable): Observable =>
    action$.ofType(SET_DONE)
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

export const IndexEpics = combineEpics(saveTodoEpic, setDoneEpic);

which are redux-observable's way of handling side-effects in Redux (like AJAX calls etc.). At the end we combine all our Epics in this file to a single exportable Epic called IndexEpics (so we only need to import one variable when we want access to these later).

The importing part may look a little weird, but it's because RxJS is a rather large library, we can either import everything using import * as RxJS from 'rxjs' or import only the parts we need as shown above, which will allow any proper minifier like UglifyJS include only the needed parts from RxJS

The first line
const saveTodoEpic: Epic = (action$: ActionsObservable): Observable =>

defines an Epic which takes in as the first type argument the type for the Actions the epic takes in (and returns), in this case IndexActions which we defined earlier, and as the second argument the type of the State it takes in (which isn't needed this time, so undefined will do). An Epic is a function that takes in a stream) (in this case of the type ActionsObservable) which includes items of the type given as the first type argument and returns another stream (in this case an Observable, which ActionsObservable is based on) which includes items of the same type as the input stream.

In JavaScript the convention is to append a $ to all variables names that are streams, to let the developer know that they are dealing with one

The second line
    action$.ofType(SET_DONE)

utilizes the inbuilt function ofType(key: string) of ActionsObservable, which basically filters out all actions that do not have the type-property of the given argument.

A more verbose, but maybe a simpler to understand version would be to write
action$.filter(action => action.type === SET_DONE)

If you find yourself needing to understand the types of the components provided by redux-observable I suggest reading this

The third and fourth line
        .delay(1000)
        .mapTo(saveTodoSuccess());

include the actual functionality of our Epic. In this case after we receive an action of the type SET_DONE we wait for 1 second (delaytakes milliseconds as argument) and then we return an action of the type SAVE_TODO_SUCCESS (in this case using mapTo as we just want to return a new Action).

If you wanted to return multiple actions, say SET_DONE_SUCCESS and an imaginary SEND_PUSH_NOTIFICATION you could do it using mergeMap, which is kind of like flatMap, like so:
import 'rxjs/add/observable/from';
import 'rxjs/add/operator/mergeMap';
...
    action$.ofType(SET_DONE)
        .mergeMap((action: SetDoneAction) => Observable.from([
            setDoneSuccess(action.payload),
            // SEND_PUSH_NOTIFICATION,
            // OTHER ACTIONS,
        ]));


The other Epic is otherwirse similar, but it uses map
        .delay(1000)
        .map((action: SetDoneAction) => setDoneSuccess(action.payload));

to return an action of the type SET_DONE_SUCCESS, using the payload of the incoming action.

If you wanted to do an AJAX call, you would go about it like this:
import { ajax } from 'rxjs/observable/dom/ajax';
...
    action$.ofType(AJAX_CALL).mergeMap((action: AjaxCallAction) =>
        // For a get JSON call
        ajax.getJSON('url', { headers: 'go here' })
            .map(response => someAction(response))
            .catch(err => errorAction(err)));
        // For all other calls, just select the correct verb
        ajax.post('url', payload, { headers: 'go here' })
            .map(response => someAction(response))
            .catch(err => errorAction(err));

Redux-observable is built upon RxJS, the JavaScript implemention of ReactiveX and most issues you will run into will be RxJS issues


Finally we define the rest of our business logic, a.k.a. the reducer itself
const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState => {
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }
};

for which I suggest to break from the redux-ducks pattern by using the naming convention of [Pagename]Reducer. The important thing to remember with reducers is that they have to be functional, a.k.a. they are not allowed to mutate the incoming information.
On the first line we define the signature of our IndexReducer
const IndexReducer = (state: IndexState = new IndexState(), action: IndexActions = DefaultAction): IndexState =>

where we define it to take to parameters (as all reducers), our IndexState (with a default for the empty state) and an action. IndexReducer will also return an IndexState (as all reducers).
Next we do the actual logic which all reducers are built upon
    switch (action.type) {
        case SET_TITLE:
            return { ...state, title: action.payload };
        case SAVE_TODO:
            return { ...state, loading: true };
        case SAVE_TODO_SUCCESS:
            return {
                ...state,
                title: '',
                todos: state.todos.concat(new Todo(state.todos.length + 1, state.title)),
                loading: false,
            };
        case SET_DONE:
            return { ...state, loading: true };
        case SET_DONE_SUCCESS:
            return {
                ...state,
                todos: state.todos.map(t => t.id === action.payload ? t.setDone() : t),
                loading: false,
            };
        default:
            return state;
    }

which is a switch-statement over the type-property of the incoming action. In each case we do something (except the default-one, where you traditionally just return the incoming state) to add value to that action, such as setting the title to the payload in the action in case the action is a SET_TITLE-action. Notice how we are using the spread syntax to immutably create a new version of the state, thus holding true to the immutability of reducers.

Other options are to use Object.assign({}, ...) or Immutable

Connecting the reducer
Remember our root-reducer? Now we connect our IndexReducer to it.
First the reducer itself
import { combineReducers } from 'redux';
import IndexReducer from '../modulex/index/IndexReducer';

const reducer = combineReducers({
    index: IndexReducer,
});

where we add the IndexReducer under the key index, which is very important, as when combineReducers combines included reducers it will put their specific state under the key given, in the global state-object.
Next we add the IndexState to our global State-class (this is just to allow us to define the type and initialize it for tests later on)
import { IndexState } from '../modules/index/IndexReducer';

export class State {
    readonly index: IndexState = new IndexState();
}

where we define that the global State-object has a property index of the type IndexState (as our combineReducer already says, but we want to be explicit here).
Then we want to add our Epics into the global epics constant
import { combineEpics } from 'redux-observable';
import { IndexEpics } from '../modules/index/IndexReducer';

export const epics = combineEpics(IndexEpics);

by including it as a parameter to combineEpics.
Finally we add our IndexActions to the global Actions-type
import { DefaultAction } from './utils';
import { IndexActions } from '../modules/index/IndexReducer';

export type Actions = DefaultAction | IndexActions;

where we say that Actions is a type where the value is either of a type of DefaultAction or one of the IndexActions.

