Completing React
Now we finally get to build our React-application into something that can be run and will actually do something! Here we make the assumption that you are going to build a medium- to large-sized application and show how to do these things in a more modular way, but for smaller applications some of these parts can be merged with the IndexView and some can be left out completely.
Initialize
We begin by installing new dependencies called React Router and ReactDOM
yarn add react-router react-dom
which adds the capability to define which URL equals which view and to render our React application to the DOM, respectively.
And of course the types for them
yarn add -D @types/react-router @types/react-dom

If you want to include your route-state in Redux you might want to look at react-router-redux

App
We begin by writing an App.ts file into the src/modules-folder
import * as React from 'react';

const App: React.StatelessComponent = props => (

        {props.children}

);

export default App;

which is just a simple view that will contain all the common styles and elements for all pages. The line of importance is the seventh one {props.children} which tells React to render the children property as React views inside the div.
Routes
Next we define our React Router routes in a file called Routes.tsx inside src/modules
import * as React from 'react';
import { Route, IndexRoute } from 'react-router';
import App from './App';
import IndexContainer from './index/IndexContainer';

const Routes = (



);

export default Routes;


On the seventh line we define that the root URL matches our previously made App
import * as React from 'react';
import { Route } from 'react-router';
import App from './App';
// ...

        // ...


using Route which takes as the first argument path the URL this Route should match to (relative URL) and as the second argument component the component to render.

On the eighth line we define our IndexRoute for the root path to be IndexContainer
import * as React from 'react';
import { IndexRoute } from 'react-router';
import IndexContainer from './index/IndexContainer';
// ...


which is a special type of Route as it defines the component it received as the child for it's parent's route (meaning that for the parent's path, this is the innermost component to show). Notice that we are setting the Container as the component instead of the View. This is what allows us to connect Redux to our React-components in the next phase.
index
Finally we create a file index.ts inside src
import * as React from 'react';
import * as ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { Router, browserHistory } from 'react-router';
import configureStore from './redux/store';
import Routes from './modules/Routes';

ReactDOM.render((



    ), document.getElementById('app'),
);

which is the entry file to our application that ties everything together.

On the eighth line
import * as ReactDOM from 'react-dom';

ReactDOM.render((
    // ...
    ), document.getElementById('app'),
))

we render our React-application to the DOM inside a div with the id app (we'll come back to this).

On the ninth line
import * as React from 'react';
import { Provider } from 'react-redux';
import configureStore from './redux/store';
// ...

        // ...


which wraps our React application with Redux using Provider from react-redux, which takes a single parameter store, for which we provide our store as we defined it in Redux.

On the tenth line
import * as React from 'react';
import { Router, browserHistory } from 'react-router';
import Routes from './modules/Routes';
// ...

// ...

we keep the UI in sync with the URL using a Router from React Router, which takes as the first argument history, where we give browserHistory as it most closely mimics the way a browser's history works and as the second argument routes we give our Routes component from before.
Index.html
Finally we write an index.html in our root-folder




        Todo app







which is just a very simple HTML-file, which imports our (soon-to-be-bundled) JavaScript from the path /js/bundle.js and contains a div with the id app so our index.ts works.
Scripts
Now as we have everything necessary for our application, it's time to get it working!
We'll begin by installing a couple of new dependencies
yarn add -D browserify budo tsify
from which browserify allows us to do import-statements in client code, budō is a lightweight server to host client code (it uses browserify under the hood) and tsify is a browserify-plugin to use it with TypeScript.

First it's time to write our development script, so head on over to your package.json and add the following
    // ...
    "scripts": {
        "develop": "budo src/index.tsx:js/bundle.js --live --verbose -- -p tsify"
    }

which allows you to start the budō server by entering yarn run develop into your console (inside the root folder of your app). It will run until it faces an error it can't recover from or you press ctrl+c. The arguments given to budō are firstly, the name of you application entry file (with a relative path), followed by the double colon with the path and name your index.html (budō expects to find it in your root folder) expects to find your application code. --live enables LiveReload (you can install a plugin to Chrome or Firefox to take full advantage of it), which automatically refreshes your browser when the source code changes. --verbose enables verbose output from budō and then all arguments after the -- will go to the browserify budō is running, in this case a plugin tsify to compile our TypeScript files.

Now it's time to build our application to be hosted on the Internet, so add the following line to your scripts inside package.json
    // ...
    "scripts": {
        // ...
        "build": "mkdir -p dist/js && browserify src/index.tsx -p tsify > dist/js/bundle.js"
    }

which will first make sure that the folder dist/js is there and then build your application with browserify. For browserify we give as first argument the entry file, then a plugin (again, tsify to use TypeScript with browserify) and finally after the > the output file name (with it's relative path). Apart from this script (run by yarn run build) you only need to copy your index.html file to the dist-folder and your application is complete!
Alternatives

An alternative for browserify is webpack, which is maybe a bit more popular these days, but I personally dislike the amount of configuration (and the way the configuration is achieved) it requires

docs/STYLES.html.body:
Styles
Next up we are going to add styles to our not-so-fancy-yet application. We are going to use Sass as it's perhaps the most widely used CSS preprocessor (and you should use one, as it helps you with managing your styles).
Initialize
First we will again add some dependencies to our project
    yarn add -D node-sass sass-lint
to actually build Sass with node-sass and then lint it with sass-lint.
Next we'll create a .sass-lint.yml file to define the conventions for our Sass-files, you can check the available rules here, but this is what I use
options:
  merge-default-rules: false
rules:
  bem-depth:
    - 4
    - max-depth: 4
  class-name-format:
    - allow-leading-underscore: false
    - convention: hyphenatedbem
  declarations-before-nesting: true
  extends-before-declarations: true

from which the first command merge-default-rules indicates that I do not want to use the default rules as a basis, the second defines that for BEM naming the maximum depth is four, the third that I don't allow class names that start with an underscore and that they must follow hyphenatedbem-convention, the fourth that I want declarations to be before nesting and the last that extends must be bedore declarations.
Styles.scss
All of our style-sheets will live inside a folder src/styles and the first will be the "main"-stylesheet, called styles.scss (scss is the Sass file extension)
@import '_variables.scss';
@import 'index.scss';
@import 'button.scss';
@import 'todocomponent.scss';
@import 'loader.scss';

body {
    background-color: $tertiary-color;
    font-family: 'Roboto', sans-serif;
}

and at this point it only imports our other (soon-to-be-written stylesheets) so that the compiler will know to bundle them all and sets two styles on our body, a background-color using the variable $tertiary-color (more about variables in a bit) and a font-family of 'Roboto', with a backup font of sans-serif. But wait, what is this 'Roboto' you might ask? It is the main font of Google's Material Design used in Android etc. and a very nice simple font. Now the way to be able to use it in our styles is to add the following line to the head element of our index.html


which will include the font from Google's CDN.
Variables
Next we will define those things we call variables in Sass in their own file called _variables.scss
// Colors
$primary-color: #343488;
$secondary-color: #5656AA;
$tertiary-color: #F0F0FF;
$modal-background: rgba(100, 100, 100, .8);

where the underscore in the beginning of the file name is just a convention to differentiate it from regular style files. Inside it we define four different colors (using comments to define the variable "blocks" of colors, sizes etc. is just another convention), a primary color, secondary color, tertiary color and a color for the background of a modal. All variables in Sass must begin with the dollar $ sign.
Index
Next up is the styles for the Index-page, inside a file called index.scss
@import '_variables.scss';

.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;

    &__header {
        color: $primary-color;
    }

    &__form {
        align-items: inherit;
        display: flex;
        flex-direction: inherit;
        justify-content: inherit;

        &__label {
            margin-bottom: 5px;
        }

        &__input {
            background-color: inherit;
            border: 0;
            border-bottom: 1px solid $primary-color;
            margin-bottom: 10px;
            text-align: center;
            width: 250px;

            &:focus {
                border-bottom: 2px solid $secondary-color;
                outline: none;
            }
        }
    }

    &__todo-container {
        display: flex;
        flex-direction: inherit;
        justify-content: flex-start;
    }
}

where we introduce nesting. I will just explain the simplest use case so you understand what is happening
@import '_variables.scss';
.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;

    &__header {
        color: $primary-color;
    }
}

where we see that first we have defined a block for the class index, which styles the flexbox properties for it. Inside we have another block, which starts with &, which is a special character in Sass as it translates the & ampersand to the parent block's selector. So the above would output as CSS something like this:
.index {
    align-items: center;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
}
.index__header {
    color: #343488;
}


This shows us the power of BEM as it ties very nicely with the nesting in Sass

Button
In a file called button.scss we are going to write our styles for the Button-component
@import '_variables.scss';

.btn {
    background-color: $tertiary-color;
    border: 1px solid $primary-color;
    border-radius: 50%;
    cursor: pointer;
}

which are very simple, like the component itself.
TodoComponent
The styles for our TodoComponent will be set in a file called todocomponent.scss
@import '_variables.scss';

.todo {
    display: flex;
    flex-direction: row;
    margin-bottom: 10px;

    &__checkbox {
        cursor: pointer;
    }

    &__number {
        margin-left: 5px;
    }

    &__title {
        margin-left: 10px;
    }
}

which is a rather simple style as well, just a little flexbox in there.
Loader
Now this is something a bit more interesting, we are going to make our Loader-component finally come to life, by creating the styles for it inside `loader.scss``
@import '_variables.scss';

.loader {
    animation: .8s fadein .2s linear forwards;
    background: $modal-background;
    height: 200vh;
    left: -50vw;
    opacity: 0;
    position: fixed;
    top: -50vh;
    width: 200vw;
    z-index: 1000;

    &__spinner:before {
        animation: spinner .6s linear infinite;
        border: 2px solid #cccccc;
        border-radius: 50%;
        border-top-color: #333333;
        box-sizing: border-box;
        content: '';
        height: 120px;
        left: 50%;
        margin-left: -60px;
        margin-top: -60px;
        position: fixed;
        top: 50%;
        width: 120px;
    }
}

@keyframes spinner {
    to {
        transform: rotate(360deg);
    }
}

@keyframes fadein {
    from {
        opacity: 0;
    }
    to {
        opacity: 1;
    }
}

and this might use some explaining. There are two major points of interest here, the first being CSS animations and the second being the :before selector.

CSS animations are built by setting a value for animation inside the CSS selector
.selector {
    animation: 1s name 2s linear forwards;
}

where the first variable (optional) is the delay for starting the animation, second is the name of the animation (more about that in a bit), third is the length of the animation, fourth is an animation timing function and the last one is animation fill mode.
Now the animation name has to match a @keyframes selector
@keyframes name {
    from {
        opacity: 0;
    }
    50% {
        opacity: 0.5;
    }
    to {
        opacity: 1;
    }
}

where you define the style for the object being styled at different points of the animation (any CSS style is valid here). You can either specify those styles with percentages (such as the 50% here) or as the from and to selectors (from for the first frame and to for the last one) or mix them up.

The :before selector on the other hand is used to create a child (it must have something set to it's content property to show) for the element, that is used to create some kind of styling otherwise impossible to create, for example in our case the actual spinning element.
Scripts
Now that we have our styles set up, we need to include them in our application and to do that, we are going to set up two new scripts to our package.json and as we want to be able to refresh both the styles and the code while developing, we are going to add a new dependency called concurrently
    yarn add -D concurrently
which is a simple NPM tool for running multiple NPM (or Yarn in this case) scripts at the same time.
Now we modify and add to get styles, starting with the develop-script
    "scripts": {
        "develop:sass": "mkdir -p dist/styles && node-sass -w -r src/styles -o dist/styles",
        "develop:client": "budo src/index.tsx:js/bundle.js --live --verbose -- -p tsify",
        "develop": "NODE_ENV=development concurrently -p \"[{name}]\" -n \"BUDO,SASS\" -c \"bgBlue,bgMagenta\" -k \"yarn run develop:client\" \"yarn run develop:sass\""
    }

where we renamed our old develop script into develop:client and created develop:sass, which uses the watch and recursive modes of node-sass to watch the src/styles-folder and output it to dist/styles. For the new develop script we use concurrently to run our develop:client and develop:sass at the same time, setting a prefix of BUDO and SASS in blue and magenta respectively (try it out to see how it looks like).

Naming the scripts something:subtask is just another convention and you are free to do it another way


Now to get the build-script to also build our styles
    "scripts": {
        "build:sass": "mkdir -p dist/styles && node-sass src/styles/styles.scss dist/styles/styles.css",
        "build:client": "mkdir -p dist/js && browserify src/index.tsx -p tsify > dist/js/bundle.js",
        "build": "yarn run build:sass && yarn run build:client",
    }

where we again rename our old build-script into build:client and then create a new script build:sass. Again we first make sure that the folder exists and then just build the Sass-files with node-sass's default settings (you can add compatibility and other plugins there as well). The new build-script will simply first build the Sass-files and then the TypeScript-files.
Alternatives

Less, another CSS preprocessor
Stylus, the "third" CSS preprocessor (Sass and Less are older)
PostCSS, a CSS postprocessor

